function printToPDF(referenceNumber, TIN, fullName, currency, amountDue, transType) {
    
    var doc = new jsPDF();
    doc.addImage(returnImg(), 'JPEG', 95, 20, 20, 20);
    doc.setFontSize(20);
    doc.setFontType('bold');
    doc.text(20, 50, 'Integrated Tax Application and Preparation System');
    doc.setFontSize(20);
    doc.text(93, 60, '(iTaPS)');
    doc.setFontSize(18);
    doc.text(75, 90, 'Tax Payable Advice');
    doc.line(75, 91, 134, 91);

    doc.setFontSize(15);
    doc.setFont('helvetica');
    doc.setFontType('bold');
    doc.text(15, 115, 'Transaction Info:');
    doc.line(15, 116, 57, 116);
    doc.setFontSize(12);
    doc.setFontType('normal');
    doc.text(15, 125, 'Date:');
    doc.setFontType('bold');
    doc.text(26, 125, moment().format('Do MMMM, YYYY'));
    doc.setFontType('normal');
    doc.text(15, 135, 'Ref #:');
    doc.setFontType('bold');
    doc.text(27, 135, referenceNumber);
    doc.setFontType('normal');
    doc.text(15, 145, 'Tax Payer TIN:');
    doc.setFontType('bold');
    doc.text(45, 145, TIN);
    doc.setFontType('normal');
    doc.text(15, 155, 'Name:');
    doc.setFontType('bold');
    doc.text(28, 155, fullName);
    doc.setFontType('normal');
    doc.text(15, 165, 'Transaction Type:');
    doc.setFontType('bold');
    doc.text(50, 165, transType);
    doc.setFontType('normal');
    doc.text(15, 175, 'Amount Due(' + currency + '):');
    doc.setFontType('bold');
    doc.text(52, 175, amountDue);
    doc.setFontType('normal');

    doc.setFontSize(15);
    doc.setFont('helvetica');
    doc.setFontType('bold');
    doc.text(112, 115, 'GRA Bank Info:');
    doc.line(112, 116, 150, 116);
    doc.setFontType('normal');
    doc.setFontSize(12);
    doc.text(113, 125, 'Bank Name:');
    doc.setFontType('bold');
    doc.text(137, 125, 'Bank of Ghana');
    doc.setFontType('normal');
    doc.text(113, 145, 'Account Name:');
    doc.setFontType('bold');
    doc.text(143, 145, 'Collection - IRS Central');
    doc.setFontType('normal');
    doc.text(113, 135, 'Branch:');
    doc.setFontType('bold');
    doc.text(129, 135, 'High Street');
    doc.setFontType('normal');    
    doc.text(113, 155, 'Account Number:');
    doc.setFontType('bold');
    doc.text(147, 155, '1018131460058');

    doc.save(`${referenceNumber}.pdf`);
}

function returnImg() {
    return 'data:image/png;base64,'
}
